import React from "react";


function App(){
$(document).on('scroll',function(){
    return(
        <>
    $('h1').css("left",Math.max(500 - 0.35*window.scrollY)+ "px");
    </>
    );
})

}




const Hello=()=>{
    return(
        <>
        
        <div className="black">
        <div className="container-fluid">
        <div className="row">
                <div className="hello">
<h1>HELLO</h1>
                </div>
                </div>
        </div>
        <div className="container-fluid">
        <div className="row">
        <div className="world">
<h1>
    WORLD
</h1>
        </div>
                
                </div>
        </div>
        </div>
        </>

    );
};

export default Hello;
